import React from 'react'
import styles from './ModalLogin.module.css';

function ModalLogin() {
  const closeModal = () => {
    setModalOpen(false);
  };
  return (
    <div className={styles.modal}>
      <button className={styles.close} onClick={closeModal}>
                X
            </button>
            <p>모달창입니다.</p>
    </div>
  );
}

export default ModalLogin
